import React, {Fragment} from 'react';

class Player extends React.Component {
    render() {
        return(
            <Fragment>
                <div className='player'>
                    <footer>
                        <h1>player</h1>
                    </footer>
                </div>
            </Fragment>
        );
    }
}

export default Player;
